var express = require('express');
var router = express.Router();

/* GET users listing. */
router.get('/profile/:token', function (req, res, next) {
    var form_action = '/user/profile/' + req.params.token;

    res.render('userprofile', { frm_action: form_action });

});

router.post('/profile/:token', function (req, res, next) {
    var qs = require("querystring");
    var http = require("https");

    var options = {
        "method": "POST",
        "hostname": "sandbox.unocoin.co",
        "port": null,
        "path": "/api/v1/settings/uploaduserprofile",
        "headers": {
            "content-type": "application/x-www-form-urlencoded",
            "authorization": "Bearer "+req.body.token,
            "cache-control": "no-cache",
            "postman-token": "3fd6b31e-23a7-c6cd-f344-1f582857e948"
        }
    };
console.log("my token is "+req.body.token);
    var req = http.request(options, function (res) {
        var chunks = [];

        res.on("data", function (chunk) {
            chunks.push(chunk);
        });

        res.on("end", function () {
            var body = Buffer.concat(chunks);
            console.log(body.toString());
        });
    });

    req.write(qs.stringify({
        name: req.body.u_name,
        mobile: req.body.u_mobile,
        pannumber: req.body.u_pannumber,
        address: req.body.u_address,
        state: req.body.u_state,
        city: req.body.u_city,
        pincode: req.body.u_pincode,
        bank_accnum: req.body.u_bank_accnum,
        ifsc: req.body.u_ifsc,
        pancard_photo:'',
        photo:'',
        address_proof:'',
        id_proof:''
    }));
    req.end();
});

module.exports = router;
